import React from 'react'
const Dashboard = () => {
    return (
    <div className="w3-container" style={{width :'100%',fontSize: '1.1em'}}>
        <button className="w3-button w3-white w3-xxlarge" onclick="w3_open()" style={{margin :'100%',fontSize: '1.1em'}}>&#9776;</button>
        <div className="w3-container">
    <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-right w3-circle w3-margin-top" style={{width:'100px'}}/>
    <h4 style={{marginTop : '1em',marginBottom: 0}} className="w3-text-gray"><b>Hello,</b></h4>
    <h4 style={{margin : 0}}><b>Sangeetha</b></h4>
    </div>
    </div> );
}

export default Dashboard;
